import { Component } from '@angular/core';
import { Observable } from 'rxjs';
import { ConsolaServiceService } from '../consola-service.service';

@Component({
  selector: 'app-consolas-list',
  templateUrl: './consolas-list.component.html',
  styleUrls: ['./consolas-list.component.sass']
})
export class ConsolasListComponent {

  consolasList$!:Observable<any[]>;
  consolas:any;


  constructor(private _service:ConsolaServiceService){}

  getAllConsolas(){
    this._service.getAllService().subscribe(response => {
      this.consolas = response;
    })
  }
}
